;;; # 1. Welcome to the @@GrapeVine@@ tutorial!
;;; 
;;; @@GrapeVine@@ is a tool for graph transformations. @@GrapeVine@@ can be used "under the hood" as a library in software projects, but it also comes with a computational notebook UI, which leverages [Gorilla](http://gorilla-repl.org). 
;;; 
;;; A computational notebook consists of mulltiple _worksheets_ (you are looking at one now). Each worksheet consists of _static_ and _executable_ _segments_. 
;;; 
;;; ## 1.1 Static segments
;;; Static segments can contain text using markdown, html, @@\LaTeX@@, images and fancy things like Mermaid diagrams that can be edited online. See below for an example ER-diagram that shows the @@GrapeVine@@ meta model (which you don't need to understand right now). If you want to edit the diagram, right-click opens in a new window with Mermaid live).
