;; **
;;; ## 1.4 Using @@GrapeVine@@ - Resources and namespaces
;;; 
;;; To make @@GrapeVine@@ available, *its library must be imported*. Under the hood, @@GrapeVine@@ connects to the graph database NEO4J. The simplest way to do the import is by using a  `(use 'grape.core')` form, but it's best practice to define a separate namespace for each worksheet. Below creates a worksheet of name `tutorial`.
;;; 
;;; (**Remember: The statement below must be executed before any @@GrapeVine@@-related commands.** 
;;; (Shift-enter) Establishing the session may take a few seconds. Wait until the green light is gone.)
;;; 
;;; Extend the statement below to import from other worksheets, if your project uses multiple worksheets.
;; **

;; @@
(ns tutorial
  (:require [grape.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; 
;; **

;; **
;;; # 2. Graphs and graph persistence
;;; 
;;; @@GrapeVine@@ uses a database to store graphs. Graphs, once defined are persisted. Arbitrarily many graphs can be created. Morevover, graphs are maintained in a [fully persistent data structures](https://en.wikipedia.org/wiki/Persistent_data_structure), i.e., _all_ versions of a graph can be accessed and modified.
;;; 
;;; A new (empty) graph is created using the `(newgrape)` function:
;; **

;; @@
(newgrape)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-list'>(</span>","close":"<span class='clj-list'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;79c0ff01-77d1-4047-bed1-bff3feabd6bd&quot;</span>","value":"\"79c0ff01-77d1-4047-bed1-bff3feabd6bd\""}],"value":"(\"79c0ff01-77d1-4047-bed1-bff3feabd6bd\")"}
;; <=

;; **
;;; As shown above, graphs are internally identified with a unique ID. That may not be convenient for the worksheet, but we can always define _vars_ to refer to graphs. The statement below defines a _var_ that refers to an empty graph.
;;; 
;;; > _Note: if you are not familiar with Clojure, you can think of vars are similar to variables in other languages._
;; **

;; @@
(def g0 (newgrape))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/g0</span>","value":"#'tutorial/g0"}
;; <=

;; **
;;; The built-in form `view` can be used to generate an image of the content of a graph. (These images are saved when the worksheet is saved.)
;; **

;; @@
(view g0)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"423\" height=\"132\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x60fdcff \"BufferedImage@60fdcff: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@627f4f64 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 423 height = 132 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x60fdcff \"BufferedImage@60fdcff: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@627f4f64 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 423 height = 132 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 423, :height 132})"}
;; <=

;; **
;;; Unsurprisingly, the graph is empty. Perhaps suprisingly, it will always remain so. (Graphs are immutable in @@GrapeVine@@).
;;; 
;;; ## 2.1 Graph Enumerations (@@Grapes@@)
;;; 
;;; If you are very perceptive (and have some knowlege of Clojure data types), you may have noted that the above call to `newgrape` returned a _sequence_ (with a single element) rather than a simple string (as indicated by the brackets `()`). Such a sequence is called a **GRAPH set Enumeration** or @@grape@@ for short. 
;;; 
;;; In @@GrapeVine@@, all operations that produce graphs actually return _grapes_ rather than graphs, even those ones that are guaranteed to generate a single graph only, such as the `newgrape` function.  
;;; 
;;; Using a single data type for operations that can produce graphs facilitates composability of operations (as we will see later). 
;;; 
;;; This technique of using a single data type is well known also from other domains, such as the data type of a "relation" in relational databases. (Even queries that are guaranteed to produce a single, unique result will still generate a relation with a single element.)
;;; 
;;; For simplicity and if the context is clear, we may continue to refer to @@grapes@@ with a single element as "graphs".
;; **

;; **
;;; # 3. Graph transformation rules
;;; 
;;; Graph transformation rules ("rules" for short) are defined in _hybrid_ language (textual input with graphical view). There are three example rules below. 
;;; 
;;; 1. The first rule (**`hello`**) creates a new node of type _Hello_
;;; 1. The second rule (**`world`**) looks for an existing node of type `Hello` and connects it with a new node of type `World`.
;;; 2. The third rule (**`vine`**) looks for two nodes of type `Hello` and `World`, respectively, which are connected with a `to` edge and replaces the `World` node with a node of type `Grape`. 
;;; 
;;; As we can see in the visualization, green colour marks new graph elements, red colour marks deleted ones, and black colour marks "preserved" elements.
;;; 
;;; > _Note: While graphs are persisted in the database, rules are not. If you want to execute any of these rules, you need to evaluate the code segment below first to declare them. Otherwise, the rules will not be known. 
;;; Also, note that enclosing these rules in a `(list ...)` form has no significance and is purely cosmetic. The only reason for having it is to render multiple rules horizontally in the visualization. Feel free to delete it if you want vertical listing of output._
;;; 
;; **

;; @@
(list
 
(rule hello []
   (create 
     (node :Hello)))

(rule world []
   (read 
      (node h:Hello))
   (create 
      (node w:World)
      (edge :to h w )))

(rule vine []
   (read 
      (node h:Hello)
      (node w:World)
      (edge e:to h w ))
   (delete w e)
   (create 
      (node g:Grape)
      (edge :to h g)))
 )
;; @@
