;; **
;;; ## 4.2 Non-determinism during matching
;;; 
;;; Consider the above example of graph `g2` again. Is there only one possible way to apply rule `rel2`? Indeed, there are **two** possible ways to apply that rule. The roles of the two nodes could also have been reversed, which would create the relationship in the _opposite_ direction. 
;;; 
;;; _Applying a rule to a graph non-deterministically picks one out of possibly many valid matches._
;;; 
;;; ## 4.3 Starred rule applications
;;; 
;;; In addition to simple rule applications, which non-deterministically pick one out of possibly many matches, @@GrapeVine@@ provides __starred rule applications__. A starred rule application applies a rule so that _all_ possible matches are performed. This generates a _set_ of graphs, where each graph represents the result of a possible rule application. The output is a @@grape@@, which contains more than a single graph. (See Section 2.1)
;;; 
;;; > _Note: this is the point in the tutorial when we start talking about "@@grapes@@" rather than graphs when referring to the input or output of operations._
;;; 
;;; Invoking a starred rule is simply done by adding an asterisk after the rules name:
;; **

;; @@
