;; **
;;; # 6. Graph Constraints
;;; 
;;; Graph constraints define conditions on the state of graphs. Graph constraints are defined based on a notion of an _atomic graph constraint_ of form **if @@X@@ then @@C@@**, where @@X@@ describes a pattern to be searched for in a graph and @@C@@ describes a necessary extension of that pattern for all found matches. 
;;; 
;;; This concept of an atomic graph constraint (_atomic constraint_ for short) has been formalized as @@\forall(c:X \longrightarrow C)@@ (see [Orejas et al.](https://dl.acm.org/doi/10.5555/1792838.1792857) for details).
;;; 
;;; ## 6.1 Basic constraints
;;; 
;;; An atomic constraint where @@X=\emptyset@@ is called a _basic atomic constraint_ or _basic constraint_ for short. It can be written as @@\exists C@@.
;;; 
;;; Consider the following basic constraint, which matches a `Hello` node that is connected to a `Grape` node via a `to` edge.
;;; 
;;; > _Note: By convention, names of constrains should end with a exclamation mark._
;;; 
;; **

;; @@
(constraint hello-to->grape! []
   (node h:Hello)
   (node p:Grape)
   (edge :to h p))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"275\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7e43b3fd \"BufferedImage@7e43b3fd: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@627f4f64 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 275 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; 
;; **

;; **
;;; ## 6.2 Using constraints to filter @@grapes@@
;;; 
;;; Like rules, constraints can be applied to _grapes_ and filter out those graphs that do not satisfy the constraint. Applications can be positive or negated.
;;; 
;;; Let's try:
;; **

;; @@
(hello-to->grape! (newgrape))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; As expected, the above pattern cannot be found in an empty graph. Let's apply the constraint in negated form. (i.e., we assert that the "hello-to->grape!" pattern may not exist). This is done by appending a minus sign (**-**) to the call of the constraint.
;; **

;; @@
(hello-to->grape!- (newgrape))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;12f918ce-d728-4f46-a293-3cfadaaf64a0&quot;</span>","value":"\"12f918ce-d728-4f46-a293-3cfadaaf64a0\""}],"value":"(\"12f918ce-d728-4f46-a293-3cfadaaf64a0\")"}
;; <=

;; **
;;; We we see above that the empty graph satisfies this negated constraint.
;;; 
;;; Conversely, let's generate a graph that satisfies the positive constraint (see below):
;; **

;; @@
(-> (newgrape) hello world vine hello-to->grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;049c7b39-3869-4411-a3b4-5203f6a5d8ee&quot;</span>","value":"\"049c7b39-3869-4411-a3b4-5203f6a5d8ee\""}],"value":"(\"049c7b39-3869-4411-a3b4-5203f6a5d8ee\")"}
;; <=

