;; **
;;; ## 6.3 Atomic Constraints
;;; 
;;; As described above, atomic constraints have the general form **if @@X@@ then @@C@@**. (Remember that basic constraints are a special case, were the pattern @@X@@ is empty, intuitively: _if TRUE then @@X@@_)
;;; 
;;; Below is an example for an atomic constraint that is _not_ a basic constraint. A graph satisfies this constraint if (and only if) all `Hello` nodes are connected to a `Grape` node by a `to` edge.
;;; 
;;; As we can see, the pattern that belongs to the "if" part is represented in black colour.
;;; 
;; **

;; @@
(cond-constraint if-hello-then-to-grape! []
       (IF   (node h:Hello))
       (THEN (node p:Grape)
               (edge :to h p)))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"319\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2d9c3a0e \"BufferedImage@2d9c3a0e: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@627f4f64 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 319 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; An empty graph satisfies this constraint:
;; **

;; @@
(-> (newgrape) if-hello-then-to-grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;8edd7717-d8aa-4c5f-afa7-85d2eddb3973&quot;</span>","value":"\"8edd7717-d8aa-4c5f-afa7-85d2eddb3973\""}],"value":"(\"8edd7717-d8aa-4c5f-afa7-85d2eddb3973\")"}
;; <=

;; **
;;; The following graph does not:
;; **

;; @@
(-> (newgrape) hello world if-hello-then-to-grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; But this one does:
;; **

;; @@
(-> (newgrape) hello world vine if-hello-then-to-grape! view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"427\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x483e02e5 \"BufferedImage@483e02e5: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@627f4f64 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x483e02e5 \"BufferedImage@483e02e5: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@627f4f64 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 427, :height 251})"}
