;; **
;;; while...
;; **

;; @@
(schema-list g1)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"list-like","open":"<span class='clj-map'>{</span>","close":"<span class='clj-map'>}</span>","separator":", ","items":[{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:graph</span>","value":":graph"},{"type":"html","content":"<span class='clj-string'>&quot;ad3a5296-dc66-4cac-8d85-15da46fc47e7&quot;</span>","value":"\"ad3a5296-dc66-4cac-8d85-15da46fc47e7\""}],"value":"[:graph \"ad3a5296-dc66-4cac-8d85-15da46fc47e7\"]"},{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:constraints</span>","value":":constraints"},{"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}],"value":"[:constraints ()]"}],"value":"{:graph \"ad3a5296-dc66-4cac-8d85-15da46fc47e7\", :constraints ()}"}],"value":"({:graph \"ad3a5296-dc66-4cac-8d85-15da46fc47e7\", :constraints ()})"}],"value":"(({:graph \"ad3a5296-dc66-4cac-8d85-15da46fc47e7\", :constraints ()}))"}
