;; **
;;; We can drop constraints by adding a `__drop__` to the schema name. Check out the following example, which drops our schema constraints "just in time" to allow the second application of rule `world`.
;; **

;; @@
(-> g2 hello world myschema-drop world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"427\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6073034a \"BufferedImage@6073034a: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@246334b8 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x6073034a \"BufferedImage@6073034a: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@246334b8 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 427, :height 251})"}
;; <=

;; **
;;; Note that grape `g2` still has our schema constraint attached. The above statement only dropped the constraint from the graph that was derived by applying rules `hello` and `world`.
;;; 
;;; >_Important: While graphs are persistently stored by @@GrapeVine@@, the definition of rules and constraints are currently __not persisted__. This means that you need to (re)evaluate the declaration of any constraints that are referenced in a graph's schema prior to working with the graph_.
;; **

;; **
;;; ## 7.1 Predefined schema constraints
;;; 
;;; While it is possible to define schema constraints using the general constraint form, @@GrapeVine@@ comes with a list of predefined constraint types, which make schema definition more convinient.
;;; 
;;; Consider for example a constraint that restricts the allowed node types. Defining such a constraint using the above means is possible but combersome. Database schema definitions often go beyond restrictions but also defined efficient search structures like B+ trees for unique keys. 
;;; 
;;; The following predefined constraint types are available:
;;; 
;;; ### 7.1.1 Nodes and Edge Labels
;;; 
;;; We can restrict the allowed node and edge labels with the `__nodelabel__` and `__edgelabel__` forms, respectively. 
;;; 
;;; Syntax: __`(nodelabels conname [l1 ... ln])`__ and __`(nodelabels conname [l1 ... ln])`__, where 
;;; * `conname` is an _optional_ name for the constraint, and
;;; * `l1` .. `ln` are names of (allowed) labels
;;; 
;;; The following example defines a schema that allows only two node labels (`Hello` and `World`) and one edge label (`to`), attaches it to a graph and demonstrates its behaviour.
;; **

;; @@
(schema myschema [
                  (nodelabels [Hello World])
                  (edgelabels	[to])
        ])

(-> (newgrape) myschema hello world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"415\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2a647118 \"BufferedImage@2a647118: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@7eb2ee79 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 415 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x2a647118 \"BufferedImage@2a647118: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@7eb2ee79 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 415 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 415, :height 251})"}
;; <=

;; **
;;; Now, the following should not be allowed, as it creates a node of type `Grape`.
;; **

;; @@
(vine _)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; ### 7.1.2 Roles
;;; 
;;; The roles that nodes can play in relationships (as sources and targets of edges) can be restricted with the __`sourceroles`__ and __`targetroles`__ forms.
;;; 
;;; Syntax: __`(sourceroles conname edgelabel [l1 l2 ... ln])`__ and __`(targetroles conname edgelabel [l1 l2 ... ln])`__, where
;;; * `conname` is an *optional* name for the constraint,
;;; * `edgelabel` is an edge label, and
;;; * `l1` .. `ln` are labels of nodes that are allowed to play the source or target role of that edge, respectively
;;; 
;;; 
;; **

;; @@
(schema myschema [
                  (sourceroles to [Hello])
                  (targetroles to [World])
                  ])

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/myschema</span>","value":"#'tutorial/myschema"}
;; <=

;; @@
(-> (newgrape) myschema hello world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"433\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4ee9d67 \"BufferedImage@4ee9d67: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@19ae6538 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 433 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x4ee9d67 \"BufferedImage@4ee9d67: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@19ae6538 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 433 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 433, :height 251})"}
;; <=

;; **
;;; Now, the following should not be allowed, since a `Grape` node cannot play the target role for a `to` edge.
;; **

;; @@
(vine _)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
