;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"427\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7180a2cc \"BufferedImage@7180a2cc: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@76a92077 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x7180a2cc \"BufferedImage@7180a2cc: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@76a92077 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 427, :height 251})"}
