;; **
;;; ### 7.1.4 Attribute uniqueness
;;; 
;;; We can define attributes to be unique for all nodes of a particular label:
;;; 
;;; Syntax: __`(unique conname nodelabel attname)`__, where
;;; * `conname` is an *optional* name for the constraint, 
;;; * `nodelabel` is a node label, and
;;; * `attname` is an attribute name
;;; 
;;; 
;; **

;; @@
(rule add-person [s]
      (create (node :Person {:SIN "'&s'"})))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"203\" height=\"147\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6c64e57e \"BufferedImage@6c64e57e: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@76a92077 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 203 height = 147 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; @@
(schema myschema [
                  (unique Person SIN)
                  ])


(-> (newgrape) myschema (add-person 123) (add-person 123) view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
