;; **
;;; # 9. Transactions 
;;; 
;;; The classical notion of transactions revolves around the ACID (atomic, consistent, isolated, durability) properties. 
;;; 
;;; ## 9.1 Durability
;;; 
;;; Since @@GrapeVine@@ uses a database, all graph productions are automatically made durable. However, not all graphs may be of interest. Moreover, identifying graphs with automatically generated IDs is inconvenient. 
;;; 
;;; Graphs can therefore be tagged with semantic names using the `commit` form. In the following example, we tag the resulting graph with the name "_mygraph_"
;;; 
;;; > **Note: `commit` tags an _individual_ graph, that needs to be selected from a @@grape@@.** (In the example below, we use commit the first (only) graph in the @@grape@@.)
;;; 
;; **

;; @@
(-> (newgrape) hello world vine)
(commit (first _) "mygraph")
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;2687732f-9bee-4e3d-9ec8-601358036f42&quot;</span>","value":"\"2687732f-9bee-4e3d-9ec8-601358036f42\""}
;; <=

;; **
;;; Once tagged, we can simply call the `graph` form to recall the graph by its semantic name, for example:
;; **

;; @@
(-> (grape "mygraph") view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"427\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x45de1ca2 \"BufferedImage@45de1ca2: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@e72b04d transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x45de1ca2 \"BufferedImage@45de1ca2: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@e72b04d transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 427, :height 251})"}
