;; **
;;; ### 9.1.1 Rolling back uninteresting derivations
;;; We may want to roll back uninteresting graph derivations, for example to free up resources or to prune the graph derivation history. We can do so by using the `rollback` form. **Warning**: calling rollback will remove _all_ graphs that are not in the trace of any _committed_ (tagged) graph.
;;; 
;;; The following example illustrates this behaviour. In the code block below, we create a graph history with four different branches, originating from the same empty start graph. We commit a tag for the end-result of one of these derivations.
;; **

;; @@
(def start (newgrape))

(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(commit (first _) "mygraph")
(-> _ history view)
