;; **
;;; ### Solving the Ferryman Problem with Invariants
;;; 
;;; Alternatively, we can solve the Ferryman Problem using invariants. We define avoidance of the two dangerous moves as enforced (negative) invariants.
;; **

;; **
;;; 
;; **

;; @@
(-> (newgrape) 
  (enforce-invariant wolf-can-eat-goat!- goat-can-eat-grape!-) 
  setup-ferryman
  (->* all_on_the_other_side! (|| ferry_one_over* cross_empty*)))
