;; **
;;; ## 11.3 (Positive) Application Conditions
;;; 
;;; We have already seen the use of the `asserts` clause for defining application conditions on individual nodes and edges. For other types of application conditions, it may not make sense to define them locally to a node or edge. For example, we may define a condition comparing the attribute values of multiple nodes. In that case, we can use the __`condition`__ form.  
;;; 
;;; The `condition` form simply takes as string that should contain a Boolean expression (in Neo4J/Cypher syntax). Rule `live-together` below shows an example:
;; **

;; @@
(rule add-person [name address]
      (create (node :Person {:name "'&name'" :address "'&address'"})))


(rule live-together []
      (read :iso (node p1:Person)
            (node p2:Person)
            (condition "p1.address=p2.address"))
      (create (edge :together p1 p2)))
