;; **
;;; ## 11.4 Optional nodes and edges
;;; 
;;; Rules may specify certain nodes and edges as __optional__. Optional graph elements will be matched if they exist in the graph, but their presence is not mandatory. Consider the following rule `salut` as an example. It replaces a `Hello` node with a `Salut` node and optionally matches a `World` node that may be connected to it. If existent, the `World` node is preserved and reconnected to the new `Salut` node.
;; **

;; @@
(rule salut []
      (read (node h:Hello)
            (node w:World :opt)
            (edge e:to h w :opt))
      (delete h e)
      (create (node s:Salut)
              (edge :to s w)))
